import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


const images = {
  logos: {
    football: require('../images/logos/football.svg'),
    tennis: require('../images/logos/tennis.svg'),
    basketball: require('../images/logos/basketball.svg'),
    cricket: require('../images/logos/cricket.svg'),
    baseball: require('../images/logos/baseball.svg'),
    hockey: require('../images/logos/hockey.svg'),
    american_football: require('./images/logos/american_football.svg'),
  }
};

export default images;

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
